column2:
SD, Sekolah Dasar adalah sekolah dasar atau yang sederajat;
SDLB, Sekolah Dasar Luar Biasa adalah satuan pendidikan/sekolah pada tingkat Sekolah Dasar (SD) yang menyelenggarakan pendidikan bagi Anak Berkebutuhan Khusus (ABK);
MI, Madrasah Ibtidaiyah adalah satuan pendidikan formal yang menyelenggarakan pendidikan umum dengan kekhasan agama Islam yang terdiri atas 6 (enam) tingkat pada jenjang pendidikan dasar (sederajat dengan SD);
Paket A adalah satuan pendidikan nonformal yang setara atau sederajat dengan jenjang pendidikan dasar (SD).

SMP, Sekolah Menengah Pertama adalah sekolah menengah pertama atau yang sederajat;
SMPLB adalah satuan pendidikan/sekolah pada tingkat Sekolah Menengah Pertama (SMP) yang menyelenggarakan pendidikan bagi Anak Berkebutuhan Khusus (ABK);
MTs, Madrasah Tsanawiyah adalah satuan pendidikan formal yang menyelenggarakan pendidikan umum dengan kekhasan agama islam yang terdiri atas 3 (tiga) tingkat pada jenjang pendidikan dasar (sederajat dengan SMP) sebagai lanjutan dari SD, MI, atau bentuk lain yang sederajat;
Paket B adalah satuan pendidikan nonformal yang setara atau sederajat dengan jenjang Sekolah Menengah Pertama (SMP).

SMA, Sekolah Menengah Atas adalah sekolah menengah atas atau yang sederajat;
SMLB adalah satuan pendidikan/sekolah pada tingkat Sekolah Menengah Atas yang menyelenggarakan pendidikan bagi Anak Berkebutuhan Khusus (ABK);
MA, Madrasah Aliyah adalah satuan pendidikan formal yang menyelenggarakan pendidikan umum dengan kekhasan agama islam yang terdiri atas 3 (tiga) tingkat pada jenjang pendidikan menengah (sederajat dengan SMA) sebagai lanjutan dari SMP, MTs, atau bentuk lain yang sederajat;
SMK, Sekolah Menengah Kejuruan adalah sekolah kejuruan setingkat SMA;
MAK, Madrasah Aliyah Kejuruan adalah salah satu bentuk satuan pendidikan formal dalam binaan Kemenag yang menyelenggarakan pendidikan kejuruan dengan kekhasan agama Islam pada jenjang pendidikan menengah sebagai lanjutan dari SMP, MTs, atau bentuk lain yang sederajat atau lanjutan dari hasil belajar yang diakui sama/setara SMP/MTs;
Paket C adalah satuan pendidikan nonformal yang setara atau sederajat dengan jenjang pendidikan Sekolah Menengah Atas (SMA).
